    [],nt"num_tags": 7,nt"name": "parker-river-national-wildlife-refuge-narrative-report-january-april-1959",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Parker River
    National Wildlife Refuge summarizes refuge activities from January through April
    of 1959.  The report begins with general information about the yearu2019s weather
    and habitat conditions.  Wildlife- including migratory birds, upland game birds,
    big game animals, fur animals, predators, rodents, other mammals, predaceous birds,
    fish, reptiles, and disease- is also covered.  The report includes a refuge development
    and maintenance section which discusses physical developments, plantings, collections
    and receipts, control of vegetation, planned burning, and fires.  Resource management
    is outlined; haying and camping permits were the primary resources.  A progress
    report on field investigations and applied research is also included.  The public
    relations section of the report discusses recreational uses of the refuge, refuge
    visitors, refuge participation, hunting, and violations.  Finally, items of interest
    and N-R forms are provided.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
